INSERT INTO `blog` (`id`, `source`, `title`, `summary`, `story`, `author`, `author_image_link`, `image_link`, `hits`, `date`) VALUES
(1, 'elabvine', 'How to start an online business?', 'There are thousands of ways to start a business online on the internet, most of these ways come from people who have started their own business and succeeded. Problem is that these people they started these business with different intentions, problems and most probably staying in different geographic location than you.', '<p>There are thousands of ways to start a business online on the internet, most of these ways come from people who have started their own business and succeeded. Problem is that these people they started these business with different intentions, problems and most probably staying in different geographic location than you. These basically means that if you follow most of these steps you have a strong chances of not having a successful online business. </p>\r\n<p>Below are 3 steps on how to start your online business successfully and anywhere in the world. </p>\r\n<h4><b>Step 1 – Find a problem you can solve</b></h4>\r\n<p>Do not start by building a product first and figuring out how it can make you money that is a very bad way to start a business. </p>\r\n<p>Create a survey that would enable people to tell you about their problems may be in health, education, retail etc. The best way to do this is to create google forms this method usually works since google forms is straight and forward, post the link on your Facebook or Twitter account you would be surprised how many people would respond from that with similar problems which you can take advantage of in solving them and making big bucks. </p>\r\n<h4><b>Step2 – Find a selling medium</b></h4>\r\n<p>A selling medium is basically a platform that you can use to sell your products or services usually websites and social media is good for selling since most people are on their phones busy you know. </p>\r\n<p>First step would be online presences this mostly requires your business to have a website and Elabvine.com can handle everything about your online presence with 100% uptime (Not 99%). You can choose from available concepts and get your website ready in a day or two and or you come up with your own concept we can build it in usually less than 7 days. </p>\r\n<h4><b>Step 3 – Use email and social media marketing to turn visitors into buyers</b></h4>\r\n<p>Having a database of (list of) visitors to your website/platform is very important because it allows you to communicate with them directly through inbox on their mobile devices. </p>\r\n<p>First step you can use to achieve direct communication with your website visitors is to ask them to sign in to your website or simply ask them to subscribe on your website and have their emails and names. Second step you can use Facebook or Twitter this step is effective because when most of your website visitors leave your website and go to either of the platforms they can sometimes see ads about your website so this makes them react in c=a certain way that might influence them to revisit your website <b>and buy. </b> </p>\r\n', 'Given Makhobela', 'img/profile.png', 'media/blog-images/how-to-start-an-online-business.png', 49, '2019-01-10 00:00:00'),
(2, 'elabvine', 'Couple of ways to market your online business', 'Online marketing is key since we have approximately 3,691,000,000 people accessing the internet daily and more importantly doing online marketing with a low budget. See https://www.emarketer.com/Report/US-Ad-Spending-eMarketer-Forecast-2017/2001998 for current global stats on ad spending and ect. Anyway I will show you how to do online marketing with a low budget or with simply no budget at all.', '<p>Online marketing is key since we have approximately 3,691,000,000 people accessing the internet daily and more importantly doing online marketing with a low budget. See <a href=https://www.emarketer.com/Report/US-Ad-Spending-eMarketer-Forecast-2017/2001998 >https://www.emarketer.com/Report/US-Ad-Spending-eMarketer-Forecast-2017/2001998</a> for current global stats on ad spending and ect. Anyway I will show you how to do online marketing with a low budget or with simply no budget at all. </p>\r\n<h4><b>Step 1 – Take advantage of SEO</b></h4>\r\n<p>Most people buy software for SEO or hire people who are apparently good with SEO well to tell you the truth SEO is free and simply not too technical unless you want to give away money buy a software or hire someone. </p>\r\n<p>What is SEO? Well SEO simply means Search Engine Optimization and Search Engine Optimizer. The first defined SEO (Search Engine Optimization) is a convenient way to come up with keywords on your website that can increase your website traffic based on the searches that people do on google, bing, duckduckgo and all other search engines daily. The second defined SEO (Search Engine Optimizer) can be a person who does what I described in the first SEO definition. </p>\r\n<p>Well to tell you the truth SEO works and taking advantage of it can turn your daily traffic to thousands of unique visitors daily. </p>\r\n<h4><b>Step 2 – Write a blog</b></h4>\r\n<p>Write a blog. Blogs are usually important if used in the right way, by right way meaning you use it to sell and up sell you products not ruthlessly so but in a quite easy simple. </p>\r\n<p>Scenario: Find a problem to speak about, come up with your solution this might be products or services and put in SEO work to increase sales. Trust me it works all of the time. </p>\r\n<p>Simple example: In order for a patient to by a medicine doctors usually tell the patients that they have certain sickness and then gives those patients prescribed medicine then boom those patients they take prescribed medicine. Basically the doctors are up selling when they give you a prescription right?!! </p>\r\n<p>Think about it. </p>\r\n<h4><b>Step 3 – Join social media groups</b></h4>\r\n<p>Let us say you join a social media group it can be on Facebook or WhatsApp or some other social media platform I do not know but has a group chat, you will find that you receive more than 150 messages a day which is crazy and the worst part is that sometimes you read them. Well how about taking advantage of group chats to sell your products and services?! </p>\r\n<p>What I mean is that we all have problems it might be in different perspectives of life, some in health, fashion and so forth. So taking advantage of group chats means that you can market your products or services based on group chat title but not in a ruthless way but in a way that influences people to want to buy your products or services or more important try them for free. You will thank me later. </p>\r\n', 'Given Makhobela', 'img/profile.png', 'media/blog-images/ways-to-market-your-online-business.png', 32, '2019-01-10 04:21:33'),
(3, 'elabvine', 'How to deal with customer care on online', 'Dealing with customer service online might seem scary, difficult or whatsoever but trust me is very simple just read up to the end and you will thank me later.\r\nMost of the companies globally are becoming active on the virtual world from online shopping to online dating I guess. Guess what even the number of complaints increases, people nowadays dealing with their complaints on a video or via inbox.', '<p>Dealing with customer service online might seem scary, difficult or whatsoever but trust me is very simple just read up to the end and you will thank me later. </p>\r\n<p>Most of the companies globally are becoming active on the virtual world from online shopping to online dating I guess. Guess what even the number of complaints increases, people nowadays dealing with their complaints on a video or via inbox. </p>\r\n<p>By utilizing these two methods it becomes simple for different institutions or businesses (small or big) to solve most of their customer problems virtually. </p>\r\n<p>To tell you the truth customers love attention meaning that they want to be heard, secondly they want a quick answer which is professional, third customers with the same problem they need the same way of being answered otherwise your business might seem not professional and forth take responsibility to avoid bad reputation. </p>\r\n<p>That is all you do not to be an expert in these steps to start executing today. </p>\r\n', 'Given Makhobela', 'img/profile.png', 'media/blog-images/how-to-deal-with-customer-care.png', 38, '2019-01-10 11:36:22');
